import React, {useState, useEffect} from "react";



function Login(){
    const loginValues={email:"", password:""};
    const[loginForm, setLoginForm]=useState(loginValues);
    
        
    const handleChange=(e)=>{
        e.preventDefault();
        const {name, value}=e.target;
        setLoginForm({...loginForm,[name]:value});
        console.log(loginForm);
    }
        
    function login(){
        console.warn(loginForm);
    }
    
   
        return(
            <div>
                <div className="Container">
                    <div className="inner-box">
                        <div className="acc-row1">
                            <h1 className="accHeading">Enter Your Login Details Below...</h1>
                            <p className="accParaDetail">Enter your details below to login or continue as guest by clicking on the button below</p>
                        </div>
                        <div className="loginAccForm">
                            <form method="" action="">
                                <input  type="email" placeholder="Enter Your Email" name="email" value={loginValues.email} 
                                onChange={handleChange}  ></input>
                                <input  type="password" placeholder="Enter Your Password" name="email" value={loginValues.password} 
                                onChange={handleChange}  ></input>
                                <button onClick={login} className="loginButton"  type="submit">Sign In</button>    
                            </form>

                       
                        </div>
                    </div>
                </div>
            </div>
        );
    
}
export default Login;
